import { PatientProvider } from "./PatientContext";
import { DoctorProvider } from "./DoctorContext";

const ContextWrapper = ({children}) => {
    return (
        <PatientProvider>
            <DoctorProvider></DoctorProvider>
        </PatientProvider>
    )
}

export default ContextWrapper;
